private boolean isFileMatching(String fileType,
    List<String> logTypes) {
  for (String logType : logTypes) {
    Pattern filterPattern = Pattern.compile(logType);
    boolean match = filterPattern.matcher(fileType).find();
    if (match) {
      return true;
    }
  }
  return false;
}
